/* eslint-disable react/jsx-no-target-blank */
import React from "react";
import "../Styles/App.css";
import { Header, Grid, Image } from "semantic-ui-react";
import Navbar from "./Navbar";

class Contact extends React.Component {
  componentDidMount = () => {
    document.body.id = "darkback";
  };

  componentWillUnmount = () => {
    document.body.id = "";
  };

  render() {
    return (
      <>
        <Navbar />
        <hr />
        <div className="center">
          <Header as="h2" className="header-about mb-0">
            Contact
          </Header>
        </div>

        <Header
          color="red"
          as="h5"
          className="subheader-about2"
          textAlign="center"
        >
          Thank you very much for visiting this website and familiarizing
          yourself with my projects and skills. <br /> If you are interested in
          my person, please contact me.
        </Header>

        <Grid textAlign="center" stackable verticalAlign="middle">
          <Grid.Row columns="2">
            <Grid.Column width="5">
              <Image
                className="mb-0"
                centered
                src={require("../Icons/email.png")}
                size="tiny"
              />
              <p className="mb-0">E-MAIL</p>
              <Header as="h2">dawid.marczak98@gmail.com</Header>
            </Grid.Column>

            <Grid.Column width="5">
              <Image
                className="mb-0"
                centered
                src={require("../Icons/linkedin-logo.png")}
                size="tiny"
              />
              <p>LINKEDIN</p>
              <Header as="h2">
                <a
                  href="https://www.linkedin.com/in/dawid-marczak/"
                  target="_blank"
                >
                  {" "}
                  www.linkedin.com/in/dawid-marczak/
                </a>
              </Header>
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </>
    );
  }
}

export default Contact;
